		"      --FK.TABLE_SCHEMA  as FROM_TABLE_SCHEMA,",
		"      FK.TABLE_NAME    as FROM_TABLE_NAME,",
		"      FK.COLUMN_NAME   as FROM_COLUMN_NAME,",
