		"DECLARE @OldEntityIDTo       varchar(100) = \'Param_OldEntityIDTo\'     --Старая сс" +
			"ылка на указаную сущность ID, куда.          ",
		"DECLARE @OldTableNameTo      varchar(100)                             --Старая та" +
			"блица, куда.        (Определяем)  ",
		"DECLARE @OldIDFieldNameTo    varchar(100)                             --Старая по" +
			"ле таблицы, куда.   (Определяем)  ",
		"",
		"--Новые данные:",
		"DECLARE @NewTableNameFrom    varchar(100) = \'Param_NewTableNameFrom\'  --Новая таб" +
			"лица имя, откуда.",
		"DECLARE @NewFieldNameFrom    varchar(100) = \'Param_NewFieldNameFrom\'  --Новое пол" +
			"е, откуда.",
		"DECLARE @NewEntityBriefTo    varchar(100) = \'Param_NewEntityBriefTo\'  --Новая ссы" +
			"лка на указаную сущность сокращение, куда.               ",
		"DECLARE @NewTableNameTo      varchar(100)                             --Новая таб" +
			"лица имя, куда.    (Определяем)  ",
		"DECLARE @NewIDFieldNameTo    varchar(100)                             --Новая таб" +
			"лица поле, куда.   (Определяем)                                   ",
		"",
		"--Вспомогательные переменные",
		"DECLARE @ErrorMes            varchar(8000) = \'\'",
		"DECLARE @TestError           int = 0",
		"DECLARE @SQLForeignKey      varchar(8000) = \'\'",
		"",
		"--Определяем имя таблицы (старой) с которой ссылка.            ",
		"SELECT @OldTableNameFrom = Name FROM fbaTable WHERE ID = @OldTableIDFrom",
		"",
		"--Определяем старое имя таблицы и старое имя поле куда ссылка.",
		"SELECT ",
		"  @OldTableNameTo   = t1.Name, ",
		"  @OldIDFieldNameTo = t1.IDFieldName ",
		"FROM fbaTable t1 ",
		"  INNER JOIN fbaEntity t2 ON t1.TableEntityID = t2.ID ",
		"WHERE t1.Type = 1 AND t2.ID = @OldEntityIDTo",
		"",
		"--Определяем новое имя таблицы и новое поле куда ссылка.",
		"SELECT ",
		"  @NewTableNameTo   = t1.Name, ",
		"  @NewIDFieldNameTo = t1.IDFieldName ",
		"FROM fbaTable t1 ",
		"  INNER JOIN fbaEntity t2 ON t1.TableEntityID = t2.ID ",
		"WHERE t1.Type = 1 AND t2.Brief = @NewEntityBriefTo",
		"",
		"--Проверка на правильность данных.",
		"--1. Проверка на то, что старая таблица и старое поле существуют.",
		"--2. Проверка на то, что новая таблица и новое поле существуют.",
		"--3. Проверка на то, что старая таблица принадлежит той же сущности что и новая.",
		"",
		"SELECT @TestError = 1 from INFORMATION_SCHEMA.COLUMNS WHERE TABLE_NAME = @OldTabl" +
			"eNameFrom AND COLUMN_NAME = @OldFieldNameFrom ",
		"IF (@TestError = 0)",
		"BEGIN",
		"  SET @ErrorMes = \'Ошибка. Не найдена таблица \' + @OldTableNameFrom + \' или поле " +
			"\' + @OldFieldNameFrom",
		"  SELECT @ErrorMes AS ErrorMes, @SQLForeignKey AS SQLForeignKey ",
		"  RETURN ",
		"END",
		"",
		"SET @TestError = 0",
		"SELECT @TestError = 1 from INFORMATION_SCHEMA.COLUMNS WHERE TABLE_NAME = @NewTabl" +
			"eNameFrom AND COLUMN_NAME = @NewFieldNameFrom ",
		"IF (@TestError = 0)",
		"BEGIN",
		"  SET @ErrorMes = \'Ошибка. Не найдена таблица \' + @NewTableNameFrom + \' или поле " +
			"\' + @NewFieldNameFrom",
		"  SELECT @ErrorMes AS ErrorMes, @SQLForeignKey AS SQLForeignKey ",
		"  RETURN ",
		"END",
		"",
		"SET @TestError = 0",
		"SELECT @TestError = 1 FROM",
		"(SELECT ",
		"  ISNULL((SELECT TableEntityID FROM fbaTable WHERE Name = @OldTableNameFrom), -1)" +
			" as Old1,",
		"  ISNULL((SELECT TableEntityID FROM fbaTable WHERE Name = @NewTableNameFrom), -2)" +
			" as New1",
		") t1  WHERE (Old1 <> New1) OR (Old1 <> @EntityID) OR (New1 <> @EntityID)         " +
			"   ",
		"IF (@TestError = 1)",
		"BEGIN",
		"  SET @ErrorMes = \'Ошибка. Сущности старой и новой таблицы не совпадают\'",
		"  SELECT @ErrorMes AS ErrorMes, @SQLForeignKey AS SQLForeignKey ",
		"  RETURN ",
		"END",
		"",
		"DECLARE @ForeignKey      varchar(1000) = \'\'",
		"DECLARE @TO_TABLE_NAME   varchar(1000) = \'\'",
		"SELECT                    ",
		"  @ForeignKey = FK.CONSTRAINT_NAME,   ",
		"  --FK.TABLE_NAME    as FROM_TABLE_NAME,  ",
		"  --FK.COLUMN_NAME   as FROM_COLUMN_NAME, ",
		"  @TO_TABLE_NAME = PK.TABLE_NAME",
		"  --PK.COLUMN_NAME   as TO_COLUMN_NAME    ",
		"FROM INFORMATION_SCHEMA.KEY_COLUMN_USAGE PK ",
		resources.GetString("$this.QueryText2"),
		resources.GetString("$this.QueryText3"),
		"WHERE                                   ",
		"  FK.TABLE_NAME      = @OldTableNameFrom",
		"  AND FK.COLUMN_NAME = @OldFieldNameFrom  ",
		"ORDER BY FK.CONSTRAINT_NAME, PK.ORDINAL_POSITION ",
		"",
		"IF (@ForeignKey <> \'\') ",
		"BEGIN",
		"  IF ((@Operation = \'OperationDel\') OR",
		"     (@OldTableNameFrom <> @NewTableNameFrom) OR ",
		"     (@OldFieldNameFrom <> @NewFieldNameFrom) OR",
		"     (@OldTableNameTo   <> @TO_TABLE_NAME))  ",
		"  BEGIN",
		"     SET @SQLForeignKey = @SQLForeignKey + \'ALTER TABLE \' + @OldTableNameFrom + \'" +
			" DROP CONSTRAINT \' + @ForeignKey + \';\' + CHAR(13) + CHAR(10)",
		"  END",
		"END",
		"",
		"",
		"/*SELECT ",
		"  @OldTableIDFrom AS OldTableIDFrom,       --Старая таблица ID, откуда.          " +
			"   ",
		"  @OldTableNameFrom    AS OldTableNameFrom, --Старая таблица имя, откуда.  (Опред" +
			"еляем)  ",
		"  @OldFieldNameFrom    AS OldFieldNameFrom, --Старое поле, откуда.               " +
			"  ",
		"  @OldEntityIDTo       AS OldEntityIDTo,    --Старая ссылка на указаную сущность " +
			"ID, куда.          ",
		"  @OldTableNameTo      AS OldTableNameTo,   --Старая таблица, куда.        (Опред" +
			"еляем)  ",
		"  @OldIDFieldNameTo    AS OldIDFieldNameTo, --Старая поле таблицы, куда.   (Опред" +
			"еляем)  ",
		"",
		"  @NewTableNameFrom    AS NewTableNameFrom, --Новая таблица имя, откуда.",
		"  @NewFieldNameFrom    AS NewFieldNameFrom, --Новое поле, откуда.",
		"  @NewEntityBriefTo    AS NewEntityBriefTo, --Новая ссылка на указаную сущность с" +
			"окращение, куда.               ",
		"  @NewTableNameTo      AS NewTableNameTo,   --Новая таблица имя, куда.    (Опреде" +
			"ляем)  ",
		"  @NewIDFieldNameTo    AS NewIDFieldNameTo, --Новая таблица поле, куда.   (Опреде" +
			"ляем)",
		"  @Operation           AS Operation",
		"--return",
		"*/",
		"",
		"IF (@Operation = \'OperationDel\') ",
		"BEGIN",
		"  SELECT @ErrorMes AS ErrorMes, @SQLForeignKey AS SQLForeignKey ",
		"  RETURN ",
		"END",
		"",
		"DECLARE @TO_COLUMN_NAME  varchar(1000)",
		"SELECT                    ",
		"  @ForeignKey = FK.CONSTRAINT_NAME,   ",
		"  --FK.TABLE_NAME    as FROM_TABLE_NAME,  ",
		"  --FK.COLUMN_NAME   as FROM_COLUMN_NAME, ",
		"  @TO_TABLE_NAME = PK.TABLE_NAME,",
		"  @TO_COLUMN_NAME = PK.COLUMN_NAME  ",
		"FROM INFORMATION_SCHEMA.KEY_COLUMN_USAGE PK ",
		resources.GetString("$this.QueryText4"),
		resources.GetString("$this.QueryText5"),
		"WHERE                                   ",
		"      FK.TABLE_NAME  = @NewTableNameFrom",
		"  AND FK.COLUMN_NAME = @NewFieldNameFrom  ",
		"ORDER BY FK.CONSTRAINT_NAME, PK.ORDINAL_POSITION ",
		"",
		"IF (@ForeignKey <> \'\') ",
		"BEGIN",
		"   IF ((@NewTableNameTo  <> @TO_TABLE_NAME) OR ",
		"      (@NewIDFieldNameTo <> @TO_COLUMN_NAME))  ",
		"  BEGIN",
		"     SET @SQLForeignKey = @SQLForeignKey + \'ALTER TABLE \' + @OldTableNameFrom + \'" +
			" DROP CONSTRAINT \' + @ForeignKey + \';\' + CHAR(13) + CHAR(10)",
		"  ",
		"  END",
		"END",
		"",
		resources.GetString("$this.QueryText6"),
		"DECLARE @ForeignKeyName varchar(100) = \'FK_\' + @NewTableNameFrom + \'_\' + @NewIDFi" +
			"eldNameTo",
		resources.GetString("$this.QueryText7"),
		"                  ",
		"SELECT @ErrorMes AS ErrorMes, @SQLForeignKey AS SQLForeignKey",
		"",
		"",
		"--select * from Agent",
		"--select * from [fbaTable] where Name = \'Agent\'",
		"--select * from [fbaAttribute] ",
		"--select * from [fbaEntity] where Brief = \'Лицо\'",
		"--select * from [fbaEntity] where Brief = \'Агент\'",
		"",
		"",
		"--(SectionEnd AttrChange)"};
